import React from 'react';
import './OverviewSection.css';

function OverviewSection() {
  return (
    <section className="overview-section">
      <h2>What is Our AI Agent?</h2>
      <p>
        Our AI agent is a state-of-the-art tool designed to optimize your business processes by leveraging advanced artificial intelligence technology.
      </p>
      <img src="/path-to-your-image.png" alt="AI Agent Overview" />
    </section>
  );
}

export default OverviewSection;
